var express = require('express');
var router = express.Router();

var gameList = [{
    id:   '1001',
    name: 'gstrategy',
    time_start: '2019-10-01',
    time_end: '2019-10-10',
    info: 'test1'
  },{
    id:   '1002',
    name: 'gstrategy2',
    time_start: '2019-10-02',
    time_end: '2019-10-10',
    info: 'test2'
  }
]

var testBase64Captchar = 'data:image/png;base64,'

/* GET home page. */
router.get('/', function(req, res, next) {
  res.render('index', { title: 'Express' });
});

router.get('/captcha/login', function(req, res, next){
  res.status(200).send({
    pic: testBase64Captchar
  })
})

router.get('/captcha/register', function(req, res, next){
  res.status(200).send({
    pic: testBase64Captchar
  })
})

router.post('/login', function(req, res, next){
  if(req.body.captcha !== '6657'){
    res.status(403).send({
      error: 'wrong captcha'
    })
  }
  else if(req.body.password !== '123456' || req.body.username !== 'tht'){
    res.status(403).send({
      error: 'wrong username or password'
    })
  }
  else {
    res.status(200).send({
      uid: 14111917,
      usertype: 'user'
    })
  }
})

router.post('/register', function(req, res, next){
  if(req.body.captcha !== '6657'){
    res.status(403).send({
      error: 'wrong captcha'
    })
  }
  else if(req.body.username === 'tht'){
    res.status(403).send({
      error: 'username already exists'
    })
  }
  else if(req.body.email === '123456@163.com'){
    res.status(403).send({
      error: 'email already exists'
    })
  }
  else {
    res.status(200).send()
  }
})

router.get('/gamelist', function(req, res, next){
  res.send({
    total: 2,
    games: gameList
  })
})


module.exports = router;
